geregisseerd door Hilde Van Mieghem
met Susan Visser, Rik Launspach en Anna Drijver

De film zoomt in op de roerige romantiek in de levens van vier vrouwen in Den Haag. Tienerdochter Eva, haar moeder Judith, tante Barbara en grote zus Anna maken er onder een Haags dak samen gezellig een potje van. Ze zijn mooi, moedig en verstandig, maar soms weten ze het ook even niet meer in een wereld vol prille verliefdheid, serial dating, ongebluste lust, affaires, kinderwensen en onverwoestbare oude liefdes.



